import React, { Component } from 'react'
import { Modal, Button } from 'react-bootstrap'
import { connect } from 'react-redux'
import { closeAddNewPhotoAction } from '../../store/actions/addNewPhotoAction'

function AddNewPhoto (props) {
    console.log(props)
    return (
        <Modal show={props.show} onHide={props.handleClose}>
            <Modal.Header closeButton>
                <Modal.Title>Add New Photo</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <input tyle='text' placeholder='Enter the photo url here...' />
                <span>Please enter the photo</span>
            </Modal.Body>
            <Modal.Footer>
                <Button variant="outline-dark" >
                        Close
                </Button>
            </Modal.Footer>
        </Modal>
    )
}
const mapDispatchToProps = (dispatch) => {
    return {
        handleClose: () => {
            dispatch(closeAddNewPhotoAction())
        }
    }
}
export default connect(null, mapDispatchToProps)(AddNewPhoto)
